      Hint: description
      Value: "<p>Our unit includes an electric starter, radiator, air cleaner, and emergency kill system. All equipment is mounted on a heavy-duty structural beam-skid with a four-point lift frame. The unit also incorporates a shutdown system and annunciation module for high compressor temperature, high engine coolant temperature, low engine oil pressure, engine underspeed, and low fuel shutdown. The unit will produce 205 ft&sup3;/min (348 m&sup3;/hr) at 1,072 engine RPM and 30 psi (207 kPa).</p>"
